import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  AppBar, Toolbar, Typography,
  Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, Paper, Box
} from "@mui/material";

export default function AccountsList() {
  const [accounts, setAccounts] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:8000/accounts")
      .then(res => res.json())
      .then(setAccounts);
  }, []);

  return (
    <Box>
      {/* ðŸ”· Top Bar */}
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6">
            AWS Cost Dashboard
          </Typography>
        </Toolbar>
      </AppBar>

      <Box sx={{ p: 3 }}>
        <Typography variant="h4" gutterBottom>
          Accounts
        </Typography>

        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell><b>Account Name</b></TableCell>
                <TableCell><b>Quoted Cost</b></TableCell>
                <TableCell><b>Onboard Date</b></TableCell>
              </TableRow>
            </TableHead>

            <TableBody>
              {accounts.map(acc => (
                <TableRow
                  key={acc.account_id}
                  hover
                  onClick={() => navigate(`/accounts/${acc.account_id}`)}
                  sx={{ cursor: "pointer" }}
                >
                  <TableCell>{acc.name}</TableCell>
                  <TableCell>${acc.quoted_cost}</TableCell>
                  <TableCell>{acc.onboard_date}</TableCell>
                </TableRow>
              ))}
            </TableBody>

          </Table>
        </TableContainer>
      </Box>
    </Box>
  );
}
